import React from 'react';
import styled from 'styled-components';
import dynamic from 'next/dynamic'
import Head from 'next/head'

const SommWidget = dynamic(() => import('../components/SommWidget'), {
  ssr: false
})

const DemoWrapper = styled.div`
  width: 100vw;
  heght: 100%;
  overflow: hidden;

  body {
    padding: 0;
    margin: 0;
  }
`;

const IFrameWrapper = styled.div`
  width: 100vw;
  height: 100%;
  min-height: 100vh;
  display: flex;

  & iframe {
    width: 100%;
    height: 100%;
  }
`;

const XOHDemo = ({}) => (
  <DemoWrapper>
    <Head>
      <meta
        name="viewport"
        content="minimum-scale=1, initial-scale=1, width=device-width, shrink-to-fit=no"
      />
    </Head>
    <IFrameWrapper>
      <iframe src="https://xoh.ca" frameBorder="0"></iframe>
    </IFrameWrapper>
    <SommWidget username="lfbakery" iconColor="#f94343" backgroundColor="#fff" position="right" message="Message"/>
  </DemoWrapper>
);

export default XOHDemo;
